let state = {

    posts: [
        {id: 1, message: 'Hi, how are you?', likesCount: 12},
        {id: 2, message: 'It is my post.', likesCount: 38},
        {id: 3, message: 'Yo', likesCount: 0},
        {id: 4, message: 'Uroy', likesCount: 13}
    ],
    dialogsData: [
        {id: 1, name: 'Sasha'},
        {id: 2, name: 'Kolechka'},
        {id: 3, name: 'Andrey'},
        {id: 4, name: 'Chekatilo'},
        {id: 5, name: 'Vorobey'}
    ],
    messagesData: [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'Byhai'},
        {id: 3, message: 'How is your wife?'},
    ]
};


export default state;
